import React, { Component } from "react";
import VoiceRecocomponent from "./voicerecocomponent";
class MainComp extends Component {
  constructor(props) {
    super(props);
    this.obset = {
      text: "Mounted",
    };
  }

  componentDidMount() {}

  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <VoiceRecocomponent />
        </div>
      </div>
    );
  }
}

export default MainComp;
